package com.sunshine.designpatter.prototype;public class Prototype implements Cloneable {	private String name;	public void setName(String name) {		this.name = name;	}	public String getName() {		return this.name;	}	/**	 * 深拷贝，指被拷贝对象总的所有引用也都拷贝，而浅拷贝不是，被拷贝对象中的引用和拷贝后的对象是同一个	 */	@Override	public Object clone() {		try {			return super.clone();		} catch (Exception e) {			e.printStackTrace();			return null;		}	}}